import React from 'react'
import "./Hp.css"
function Home(props) {
  console.log(props.data)
  return (
    <>
    {props.data.map((e) => {
          return  (<div class="card">
            <p class="heading">
              Popular this month
            </p>
            {<img src="image.jpg"></img>}
            <p>
              Powered By
            </p>
            </div>)
        })
      }
    
    
    </>
      
 


  )
}

export default Home
